'use client'
import  { PdfViewerComponent, Toolbar, Magnification, Navigation, LinkAnnotation, BookmarkView,
         ThumbnailView, Print, TextSelection, Annotation, TextSearch, FormFields, FormDesigner, Inject} from '@syncfusion/ej2-react-pdfviewer';
import { ButtonComponent } from '@syncfusion/ej2-react-buttons';

export function App() {
let viewer: PdfViewerComponent | null;
let documentPath: string = "data:application/pdf;base64,";
const deleteFormField = () => {
  var formFieldCollections = viewer?.formFieldCollections;
  if(formFieldCollections){
    for(var i=0; i<formFieldCollections?.length; i++){
      if(formFieldCollections[i].pageNumber == viewer?.pageCount){
        viewer?.formDesignerModule.deleteFormField(viewer.formFieldCollections[i]);
        i--;
      }
    }
  }
};


const loadPdf = () => {
  viewer?.load(documentPath, "");
};

return (<div>
    <div className='control-section'>
      <ButtonComponent onClick={loadPdf}>Load Pdf</ButtonComponent>
      <ButtonComponent onClick={deleteFormField}>Delete FormField</ButtonComponent>
        <PdfViewerComponent 
            ref={(scope) => { viewer = scope; }}
            id="container" 
            resourceUrl="https://cdn.syncfusion.com/ej2/26.2.11/dist/ej2-pdfviewer-lib"
            style={{ 'height': '640px' }}>
               {/* Inject the required services */}
               <Inject services={[ Toolbar, Magnification, Navigation, Annotation, LinkAnnotation, BookmarkView, ThumbnailView,
                                   Print, TextSelection, TextSearch, FormFields, FormDesigner]} />
        </PdfViewerComponent>
    </div>
</div>

);
}
export default App;